const removeGarbage = arr => {
    const stack = [];
    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === '<') {
            let count = 0,
                str = '';
            do {
                i++;
                if (arr[i] === '!') i++;
                else str += arr[i];
                count++;
            } while (count < 2 || arr[i - 1]!== '>' || arr[i]!== '>');
            stack.push(str);
        }
    }
    return [...stack].join('');
};

