class Solution {
    public String[] replace(String[] arr) {
        for (int i = 0; i < arr.length; i++) {
            if (!arr[i].equals(".")) {
                boolean isMax = true;
                for (int j = i - 1; j >= 0; j--) {
                    if (arr[j].compareTo(arr[i]) > 0) {
                        isMax = false;
                        break;
                    }
                }
                for (int k = i + 1; k < arr.length; k++) {
                    if (arr[k].compareTo(arr[i]) > 0) {
                        isMax = false;
                        break;
                    }
                }
                if (!isMax) {
                    arr[i] = ".";
                }
            }
        }
        return arr;
    }
}

