    public String move(String s) {
        if (s == null || s.length() <= 1) return s;
        char[] arr = s.toCharArray();
        int i = 0, j = 0;
        while (i < arr.length && j < arr.length) {
            if (arr[j]!= '.') {
                swap(arr, i++, j);
            }
            j++;
        }
        return new String(arr);
    }

    private void swap(char[] arr, int a, int b) {
        char tmp = arr[a];
        arr[a] = arr[b];
        arr[b] = tmp;
    }
}

