        if (index >= s.length()) {
            result.add(cur);
            return;
        }
        char c = s.charAt(index);
        if (c!= '.') {
            StringBuilder sb = new StringBuilder(cur);
            for (int i = 0; i < list.size(); ++i) {
                sb.append(list.get(i));
