            char c = S.charAt(len);
            if (c == '.') break;
            int count = 0;
            while (len < S.length() && S.charAt(len) == c) {
                count++;
                len++;
            }
            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < count; i++) {
                sb.append(c);
            }
            res.add(sb.toString());
        }
        if (len >= S.length()) return new String[]{S};
        List<String> temp = new ArrayList<>();
        dfs(res, temp, S, len);
        Collections.sort(temp, new Comparator<String>() {
            @Override
            public int compare(String o1, String o2) {
                return o1.compareTo(o2);
            }
        });
        return temp.toArray(new String[temp.size()]);
    }

    private void dfs(List<String> res, List<String> temp, String s, int index) {
        if (index >= s.length()) {
            StringBuilder sb = new StringBuilder();
            for (String str : res) {
                sb.append(str);
            }
            temp.add(sb.toString());
            return;
        }
        char c = s.charAt(index);
        if (c!= '.') {
            int count = 0;
            while (index < s.length() && s.charAt(index) == c) {
                count++;
                index++;
            }
            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < count; i++) {
                sb.append(c);
            }
            res.add(sb.toString());
            dfs(res, temp, s, index);
            res.remove(res.size() - 1);
        } else {
            res.add("");
            dfs(res, temp, s, index + 1);
            res.remove(res.size() - 1);
            for (String str : res) {
                res.set(res.size() - 1, str + ".");
                dfs(res, temp, s, index + 1);
            }
        }
    }
}

