                    break;
                case 'x':
                    if (row!= 2) return false;
                    break;
                case 'c':
                    if (row!= 2) return false;
                    break;
                case 'v':
                    if (row!= 2) return false;
                    break;
                case 'b':
                    if (row!= 3) return false;
                    break;
                case 'n':
                    if (row!= 3) return false;
                    break;
                case'm':
                    if (row!= 3) return false;
                    break;
                default:
                    return false;
            }
            row = (row + 1) % 6;
        }
        return true;
    }
