                    break;
                default:
                    if (i % 2 == 0) {
                        input[i] = "e";
                    } else {
                        input[i] = "i";
                    }
            }
        }
        return input;
    }

    private void swap(String[] arr, int a, int b) {
        String tmp = arr[a];
        arr[a] = arr[b];
        arr[b] = tmp;
    }
}

