                        board[r] = board[r].substring(0, c) + "x" + board[r].substring(c + 1);
                    }
                }
            }
        }

        // check corner
        for (int d = 0; d < 4; ++d) {
            int r = board.length - 1;
            int c = board.length - 1;
            if (d % 2 == 0) {
